INSERT INTO `slow_queries` (`sid`, `query`, `value`, `execution_time`, `dtstamp`, `status`) VALUES
	(1, 'SELECT mf.uf_id, fs.fs_id, fs.farmer_code, s.Society_Name, v.villcdname, IFNULL(mf.farmer_name_hi, mf.farmer_name_aadhar) AS farmer_name, mf.father_name, mf.mobile_no, CONCAT(\'XXXX-XXXX-\', SUBSTRING(mf.aadhar_number, 9,LENGTH(mf.aadhar_number))) AS aadhar_no FROM farmer_society fs\nINNER JOIN mas_farmer mf ON mf.uf_id = fs.uf_id\nINNER JOIN society s ON s.Society_Id = fs.society_id\nINNER JOIN mas_villages v ON v.vsr_census = fs.village_code\nWHERE fs.society_id = 420089 AND fs.carry_forward_status IS null \nORDER BY fs.village_code, mf.farmer_name_hi;SELECT COUNT(fs.fs_id) as total\n    FROM farmer_society fs\n    LEFT JOIN mas_farmer mf ON mf.uf_id = fs.uf_id\n    WHERE fs.society_id = 420089 AND fs.carry_forward_status IS null ;', '', 1.000000, '2024-06-21 17:05:43', 0),
	(2, 'SELECT mf.uf_id, fs.fs_id, fs.farmer_code, s.Society_Name, v.villcdname, IFNULL(mf.farmer_name_hi, mf.farmer_name_aadhar) AS farmer_name, mf.father_name, mf.mobile_no, CONCAT(\'XXXX-XXXX-\', SUBSTRING(mf.aadhar_number, 9,LENGTH(mf.aadhar_number))) AS aadhar_no FROM farmer_society fs\nINNER JOIN mas_farmer mf ON mf.uf_id = fs.uf_id\nINNER JOIN society s ON s.Society_Id = fs.society_id\nINNER JOIN mas_villages v ON v.vsr_census = fs.village_code\nWHERE fs.society_id = 420089 AND fs.carry_forward_status IS null \nORDER BY fs.village_code, mf.farmer_name_hi;SELECT COUNT(fs.fs_id) as total\n    FROM farmer_society fs\n    LEFT JOIN mas_farmer mf ON mf.uf_id = fs.uf_id\n    WHERE fs.society_id = 420089 AND fs.carry_forward_status IS null ;', '', 1.000000, '2024-06-21 17:12:30', 0),
	(3, 'SELECT d.District_ID, d.District_Name AS name, SUM(r.nf) nf, SUM(r.society_sf) society_sf, SUM(r.tehsil_sf) tehsil_sf, \nSUM(r.raeo_nf) raeo_nf, SUM(r.raeo_sf) raeo_sf, SUM(r.raeo_rf) raeo_rf\nFROM officer_village_details o \nINNER JOIN panjiyan_report r ON r.village_code = o.village_code\nINNER JOIN society s ON s.Society_Id = r.society_id\nINNER JOIN mas_districts d ON d.District_ID = s.District_Id\nINNER JOIN mas_tehsil t ON t.District_ID = s.District_Id AND t.Tehsil_ID = s.Block_Id\nINNER JOIN mas_villages v ON v.vsr_census = r.village_code\nGROUP BY s.District_Id', '', 1.000000, '2024-07-10 12:08:07', 0),
	(4, 'SELECT mf.uf_id, fs.fs_id, fs.farmer_code, s.Society_Name, v.villcdname, IFNULL(mf.farmer_name_hi, mf.farmer_name_aadhar) AS farmer_name, mf.father_name, mf.mobile_no, CONCAT(\'XXXX-XXXX-\',9, SUBSTRING(mf.aadhar_number, 9,LENGTH(mf.aadhar_number))) AS aadhar_no FROM farmer_society fs\nINNER JOIN mas_farmer mf ON mf.uf_id = fs.uf_id\nINNER JOIN society s ON s.Society_Id = fs.society_id\nINNER JOIN mas_villages v ON v.vsr_census = fs.village_code\nWHERE fs.society_id = 590065 AND fs.carry_forward_status IS null and fs.delete_status is null \nORDER BY fs.village_code, mf.farmer_name_hi;SELECT COUNT(fs.fs_id) as total\n    FROM farmer_society fs\n    LEFT JOIN mas_farmer mf ON mf.uf_id = fs.uf_id\n    WHERE fs.society_id = 590065 AND fs.carry_forward_status IS null and fs.delete_status is null ;', '', 1.000000, '2024-07-22 12:00:29', 0);
